import React from 'react';
import s from "./Header.css";

export default function Header() {
  return (
    <header>
      <div className='header'>
        <a class="link" href='/Home' className='logo'></a>
        <a class="link" href="/Catalog"className='Catalog'>Catalog</a>
        <ul className='navigation'>
          <a class="link" href='/Home'>Main Page</a>
          <a class="link" href='/Catalog'>All Products</a>
          <a class="link" href='/Sales'>All sales</a>
          <a></a>
        </ul>
        <a href='ShoppingCart' className='cart'></a>
      </div>
    </header>    
  )
}
